import React from 'react';
import './App.css';

function ForecastTwo() {
 
	return (
		<div className="weather-forecast__row">
			<span className="weather-forecast__day"></span>
			<span className="weather-forecast__icon">
				<i className="fa fa-clock-o" />
				{props.time}
			</span>
			<span className="weather-forecast__high"></span>
			<span className="weather-forecast__low"></span>
		</div>
	);
}

export default ForecastTwo;
